import albertoPicture from '../assets/alberto.png'

export const UserRanked = ({ image, name, rating }) => {
  return (
    <div className="rounded-xl w-30 mb-3 mr-8 font-montserrat ml-20 bg-[#D9D9D9] shadow-md flex flex-row">
      <img src={albertoPicture} className="w-8 h-9 mr-2"></img>
      <p className="m-5 tracking-wide">{name}</p>
      <p className="text-right">{rating}</p>
    </div>
  );
};
